import React from "react";
import Knob from "./../../common/Knob/Knob";


const EqKnob = props =>{
    return (
        <Knob className="mikser-knob" symetric showValue scale={10} quantize={0.5} onChange={ props.onChange }/>
    )
}

export default EqKnob;
